Job Description

Gameloft Online Team provides a solid API for all the features that connect to our main servers. They enhance the games and allow users to play via multiplayer, compete in leader boards, get rewarded for their activity and last but not least to stay in touch.
Gameloft Bucharest is looking for 2 new Senior PHP Developers to join our Online Games Team.
Why join us:
• How would you like to be part of the team powering up triple A Titles on Android Market or Appstore?
• Improve your programming skills and techniques to meet the demands of millions of users;
• Work with large scale user databases (hundreds of millions of daily new entries);
• Improve your skills on database optimization, caching, service architecture, data mining and cutting edge noSQL technologies
Overall responsibility:
• Online developers must be focused on finding simple enough solutions so that other teams can easily use the API but in the same time robust enough to support the heavy traffic we experience each day. Backend optimization and low level programming skills are a must.
Key areas of responsibility:
• Develop new features for existing projects;
• Database and project design for new projects based on specifications;
• Maintenance and support for existing features.

Qualifications
• Experienced with PHP 5, MySQL5 and database optimization techniques;
• Good knowledge of HTML, JavaScript , jQuery and mobile web is a plus;
• Experience with Python and Linuxpackaging is considered a big plus
• Good English speaking and writing;
• Communication skills and ability to integrate quickly in a team;
• Passionate and innovative, thinking outside of the box when needed;
• Rigor, autonomy and organizational skills are essential.
Additional Information
• Motivating salary and a merit based pay system;
• Lunch tickets;
• Medical insurance package, in partnership with Regina Maria Clinic;
• Supportive working climate, a young and dynamic team with a free communication style and also the possibility to make outstanding performances fairly rewarded;
• Get the chance to work in a multinational team;
• Expand your professional knowledge and career very fast;
• A modern office complex including:
• Cafeteria with hot food open during working hours
• Gym facilities
• Relaxation area with pool tables, ping pong tables, darts, foosball
• Kickboxing classes in the gym facility free for employees
• Dance classes (beginner and advanced groups) in the gym facility free for employees;
• Free access to football court and basketball court – 2 hours, once a week, both courts are close to the office.
• Please forward your CV and motivation letter to the following email address: ancaemilia.mihaila [at]gameloft.com
